import React from 'react'

const Portifolio = () => {
    return (
        <div>
		<ul>
			{repositories.map(repository =>{
				return(
					<li>
						<h3>{repository.name}</h3>
					</li>
				)
			})}
		</ul>
	</div>
    )
}

export default Portifolio
